import React, { Component } from 'react';
import { Container } from 'react-bootstrap';
import Navigation from 'components/Navigation/Navigation';

const layout = ( props ) => {
        return(
            <Container>
        <Navigation/>
        {this.props.children}
    </Container>
        )
}

export default layout;
